import React from 'react';
import Header from "./componentes/Header";
import TimeLine from "./componentes/TimeLine"

function App() {
  return (
    <div id="root">
      <div  className="main">

        <Header></Header>

        <TimeLine login={this.props.params.login} ></TimeLine>

      </div> 
    </div> 
    // <!--fim #root-->
  );
}

export default App;
